'dom/chrome/netError.dtd:proxyConnectFailure.longDesc' => '&#60;p&#62;ഒരു പ്രോക്സി സര്‍വര്‍ ഉപയോഗിക്കുന്നതിനായി ബ്രൗസറിനെ ക്രമീകരിച്ചിരിക്കുന്നു, പക്ഷേ പ്രോക്സി കണക്ഷന്‍ നിരസിച്ചിരിക്കുന്നു.&#60;/p&#62;&#60;ul&#62;&#60;li&#62;ബ്രൗസറിന്റെ പ്രോക്സി ക്രമീകരണം ശരിയാണോ? അവ പരിശോധിച്ച് വീണ്ടും ശ്രമിക്കുക.&#60;/li&#62;&#60;li&#62;ഈ നെറ്റ്‌വര്‍ക്കില്‍ നിന്നുള്ള കണക്ഷനുകള്‍ പ്രോക്സി സര്‍വീസ് അനുവദിക്കുന്നുവോ?&#60;/li&#62;&#60;li&#62;എന്നിട്ടും പ്രശ്നം ഉണ്ടോ? എങ്കില്‍ നെറ്റ്‌വര്‍ക്ക്അഡ്മിനിസ്ട്രേറ്റര്‍ അല്ലെങ്കില്‍ ഇന്റര്‍നെറ്റ് പ്രൊവൈഡറുമായി ബന്ധപ്പെടുക.&#60;/li&#62;&#60;/ul&#62;',
'dom/chrome/netError.dtd:proxyResolveFailure.longDesc' => '&#60;p&#62;ഒരു പ്രോക്സി സര്‍വര്‍ ഉപയോഗിക്കുന്നതിനായി ബ്രൗസറിനെ ക്രമീകരിച്ചിരിക്കുന്നു, പക്ഷേ പ്രോക്സി  ലഭ്യമാകുന്നില്ല.&#60;/p&#62;&#60;ul&#62;&#60;li&#62;ബ്രൗസറിന്റെ പ്രോക്സി ക്രമീകരണം ശരിയാണോ? അവ പരിശോധിച്ച് വീണ്ടും ശ്രമിക്കുക.&#60;/li&#62;&#60;li&#62;കംപ്യൂട്ടര്‍ സജീവമായ ഒരു നെറ്റ്‌വര്‍ക്കിലാണോ?&#60;/li&#62;&#60;li&#62;എന്നിട്ടും പ്രശ്നം ഉണ്ടോ? എങ്കില്‍ നെറ്റ്‌വര്‍ക്ക്അഡ്മിനിസ്ട്രേറ്റര്‍ അല്ലെങ്കില്‍ ഇന്റര്‍നെറ്റ് പ്രൊവൈഡറുമായി  ബന്ധപ്പെടുക.&#60;/li&#62;&#60;/ul&#62;',
